import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';// precisa fazer a desestruturação
import Login from './pages/Login'; // cada pagina sendo importada
import Search from './pages/Search';
import Album from './pages/Album';
import Favorites from './pages/Favorites';
import Profile from './pages/Profile';
import ProfileEdit from './pages/ProfileEdit';
import NotFound from './pages/NotFound';

function App() {
  return ( // Browser Router componente que encapsula a app, possibilita navegar pelas paginas na URl
  // Route é a rota, um caminho pra encontrar cada componente - requisito 1 -
    <BrowserRouter>

      <Route exact path="/" component={ Login } />
      <Route path="/search" component={ Search } />
      <Route path="/album/:id" component={ Album } />
      <Route path="/favorites" component={ Favorites } />
      <Route exact path="/profile" component={ Profile } />
      <Route path="/profile/edit" component={ ProfileEdit } />
      <Route component={ NotFound } />

    </BrowserRouter>
  );
}

export default App;
